// ! Selecting the Image
  void selectImage(ImageSource source) async {
    XFile? pickedFile = await ImagePicker().pickImage(source: source);

    if (pickedFile != null) {
      // ! we are cropping the image now
      // cropImage(pickedFile);
      setState(() {
        imageFile = File(pickedFile.path);
      });
    }
  }

  void convertToBase64() async {
    // ByteData bytes = await rootBundle.load('assets/modelPix/3.jpeg');
    // var buffer = bytes.buffer;
// var m = base64.encode(Uint8List.view(buffer));

    Uint8List? _bytes = await imageFile!.readAsBytes();
    String _base64String = base64.encode(_bytes);
    setState(() {
      base64String = _base64String;
    });
    print(base64String.toString());
  }

// ! Cropping the Image
  void cropImage(XFile file) async {
    CroppedFile? croppedImage = await ImageCropper().cropImage(
        sourcePath: file.path,
        aspectRatio: const CropAspectRatio(ratioX: 1, ratioY: 1),
        compressQuality: 20);
    if (croppedImage != null) {
      // ! we need "a value of File Type" so here we are converting the from CropperdFile to File
      final File croppedFile = File(
        croppedImage.path,
      );
      setState(() {
        imageFile = croppedFile;
      });
    }
  }

